{
  "properties": {
    "template": {
      "$schema": "http://schema.management.azure.com/schemas/2015-01-01/deploymentTemplate.json#",
      "contentVersion": "1.0.0.0",
      "parameters": {
        "rgName": {
          "type": "String"
        },
        "location": {
          "type": "String"
        },
        "virtualMachineName": {
          "type": "String"
        },
        "virtualMachineSize": {
          "type": "String"
        },
        "adminUsername": {
          "type": "String"
        },
        "storageAccountName": {
          "type": "String"
        },
        "virtualNetworkName": {
          "type": "String"
        },
        "routeTableName": {
          "type": "String"
        },
        "networkInterfaceName": {
          "type": "String"
        },
        "networkSecurityGroupName": {
          "type": "String"
        },
        "adminPassword": {
          "type": "SecureString"
        },
        "storageAccountType": {
          "type": "String"
        },
        "diagnosticsStorageAccountName": {
          "type": "String"
        },
        "diagnosticsStorageAccountId": {
          "type": "String"
        },
        "diagnosticsStorageAccountType": {
          "type": "String"
        },
        "addressPrefix": {
          "type": "String"
        },
        "subnetName": {
          "type": "String"
        },
        "subnetPrefix": {
          "type": "String"
        },
        "publicIpAddressName": {
          "type": "String"
        },
        "publicIpAddressType": {
          "type": "String"
        }
      },
      "variables": {
        "vnetId": "[resourceId(parameters('rgName'),'Microsoft.Network/virtualNetworks', parameters('virtualNetworkName'))]",
        "subnetRef": "[concat(variables('vnetId'), '/subnets/', parameters('subnetName'))]"
      },
      "resources": [
        {
          "type": "Microsoft.Compute/virtualMachines",
          "name": "[parameters('virtualMachineName')]",
          "apiVersion": "2015-06-15",
          "location": "[parameters('location')]",
          "properties": {
            "osProfile": {
              "computerName": "[parameters('virtualMachineName')]",
              "adminUsername": "[parameters('adminUsername')]",
              "adminPassword": "[parameters('adminPassword')]",
              "windowsConfiguration": {
                "provisionVmAgent": "true"
              }
            },
            "hardwareProfile": {
              "vmSize": "[parameters('virtualMachineSize')]"
            },
            "storageProfile": {
              "imageReference": {
                "publisher": "MicrosoftWindowsServer",
                "offer": "WindowsServer",
                "sku": "2016-Datacenter",
                "version": "latest"
              },
              "osDisk": {
                "name": "[parameters('virtualMachineName')]",
                "createOption": "fromImage",
                "vhd": {
                  "uri": "[concat(concat(reference(resourceId(parameters('rgName'), 'Microsoft.Storage/storageAccounts', parameters('storageAccountName')), '2015-06-15').primaryEndpoints['blob'], 'vhds/'), parameters('virtualMachineName'), '20161217141554.vhd')]"
                }
              },
              "dataDisks": []
            },
            "networkProfile": {
              "networkInterfaces": [
                {
                  "id": "[resourceId('Microsoft.Network/networkInterfaces', parameters('networkInterfaceName'))]"
                }
              ]
            },
            "diagnosticsProfile": {
              "bootDiagnostics": {
                "enabled": true,
                "storageUri": "[reference(resourceId(parameters('rgName'), 'Microsoft.Storage/storageAccounts', parameters('diagnosticsStorageAccountName')), '2015-06-15').primaryEndpoints['blob']]"
              }
            }
          },
          "dependsOn": [
            "[concat('Microsoft.Network/networkInterfaces/', parameters('networkInterfaceName'))]",
            "[concat('Microsoft.Storage/storageAccounts/', parameters('storageAccountName'))]",
            "[concat('Microsoft.Storage/storageAccounts/', parameters('diagnosticsStorageAccountName'))]"
          ]
        },
        {
          "type": "Microsoft.Storage/storageAccounts",
          "name": "[parameters('storageAccountName')]",
          "apiVersion": "2015-06-15",
          "location": "[parameters('location')]",
          "properties": {
            "accountType": "[parameters('storageAccountType')]"
          }
        },
        {
          "type": "Microsoft.Storage/storageAccounts",
          "name": "[parameters('diagnosticsStorageAccountName')]",
          "apiVersion": "2015-06-15",
          "location": "[parameters('location')]",
          "properties": {
            "accountType": "[parameters('diagnosticsStorageAccountType')]"
          }
        },
        {
          "type": "Microsoft.Network/routeTables",
          "name": "[parameters('routeTableName')]",
          "apiVersion": "2016-09-01",
          "location": "[parameters('location')]",
          "properties": {
            "routes": [
              {
                "name": "route1",
                "properties": {
                  "addressPrefix": "10.1.3.0/24",
                  "nextHopType": "VirtualAppliance",
                  "nextHopIpAddress": "10.0.1.2"
                }
              }
            ]
          }
        },
        {
          "type": "Microsoft.Network/virtualNetworks",
          "name": "[parameters('virtualNetworkName')]",
          "apiVersion": "2016-09-01",
          "location": "[parameters('location')]",
          "properties": {
            "addressSpace": {
              "addressPrefixes": [
                "[parameters('addressPrefix')]"
              ]
            },
            "subnets": [
              {
                "name": "[parameters('subnetName')]",
                "properties": {
                  "addressPrefix": "[parameters('subnetPrefix')]",
                  "routeTable": {
                    "id": "[resourceId('Microsoft.Network/routeTables', parameters('routeTableName'))]"
                  }
                }
              }
            ]
          },
          "dependsOn": [
            "[concat('Microsoft.Network/routeTables/', parameters('routeTableName'))]"
          ]
        },
        {
          "type": "Microsoft.Network/networkInterfaces",
          "name": "[parameters('networkInterfaceName')]",
          "apiVersion": "2016-09-01",
          "location": "[parameters('location')]",
          "properties": {
            "ipConfigurations": [
              {
                "name": "ipconfig1",
                "properties": {
                  "subnet": {
                    "id": "[variables('subnetRef')]"
                  },
                  "privateIPAllocationMethod": "Dynamic",
                  "publicIpAddress": {
                    "id": "[resourceId(parameters('rgName'),'Microsoft.Network/publicIpAddresses', parameters('publicIpAddressName'))]"
                  }
                }
              }
            ],
            "networkSecurityGroup": {
              "id": "[resourceId(parameters('rgName'), 'Microsoft.Network/networkSecurityGroups', parameters('networkSecurityGroupName'))]"
            }
          },
          "dependsOn": [
            "[concat('Microsoft.Network/virtualNetworks/', parameters('virtualNetworkName'))]",
            "[concat('Microsoft.Network/publicIpAddresses/', parameters('publicIpAddressName'))]",
            "[concat('Microsoft.Network/networkSecurityGroups/', parameters('networkSecurityGroupName'))]"
          ]
        },
        {
          "type": "Microsoft.Network/publicIpAddresses",
          "name": "[parameters('publicIpAddressName')]",
          "apiVersion": "2016-09-01",
          "location": "[parameters('location')]",
          "properties": {
            "publicIpAllocationMethod": "[parameters('publicIpAddressType')]"
          }
        },
        {
          "type": "Microsoft.Network/networkSecurityGroups",
          "name": "[parameters('networkSecurityGroupName')]",
          "apiVersion": "2016-09-01",
          "location": "[parameters('location')]",
          "properties": {
            "securityRules": [
              {
                "name": "default-allow-rdp",
                "properties": {
                  "priority": 1000,
                  "sourceAddressPrefix": "*",
                  "protocol": "TCP",
                  "destinationPortRange": "3389",
                  "access": "Allow",
                  "direction": "Inbound",
                  "sourcePortRange": "*",
                  "destinationAddressPrefix": "*"
                }
              }
            ]
          }
        }
      ],
      "outputs": {
        "adminUsername": {
          "type": "String",
          "value": "[parameters('adminUsername')]"
        }
      }
    },
    "parameters": {
      "rgName": {
        "value": "psnrp8982"
      },
      "location": {
        "value": "West Central US"
      },
      "virtualMachineName": {
        "value": "psnrp6509"
      },
      "virtualMachineSize": {
        "value": "Standard_A4"
      },
      "adminUsername": {
        "value": "netanaytics12"
      },
      "storageAccountName": {
        "value": "psnrp3050"
      },
      "routeTableName": {
        "value": "psnrp6971"
      },
      "virtualNetworkName": {
        "value": "psnrp1999"
      },
      "networkInterfaceName": {
        "value": "psnrp7161"
      },
      "networkSecurityGroupName": {
        "value": "psnrp299"
      },
      "adminPassword": {
        "value": "netanalytics-32psnrp8982"
      },
      "storageAccountType": {
        "value": "Standard_LRS"
      },
      "diagnosticsStorageAccountName": {
        "value": "psnrp6629"
      },
      "diagnosticsStorageAccountId": {
        "value": "Microsoft.Storage/storageAccounts/psnrp6629"
      },
      "diagnosticsStorageAccountType": {
        "value": "Standard_LRS"
      },
      "addressPrefix": {
        "value": "10.17.3.0/24"
      },
      "subnetName": {
        "value": "default"
      },
      "subnetPrefix": {
        "value": "10.17.3.0/24"
      },
      "publicIpAddressName": {
        "value": "psnrp6509-ip"
      },
      "publicIpAddressType": {
        "value": "Dynamic"
      }
    },
    "mode": "Incremental"
  }
}

